import React from "react";
import {
  XYPlot,
  VerticalBarSeries
} from 'react-vis';
class MyLinegraph extends React.Component {
  

render() {
  const data = this.props.data;
  const chartWidth = 800;
  const chartHeight = 500;
  const chartDomain = [0, chartHeight];
    return (
      <XYPlot 
               xType="ordinal" 
               width={chartWidth} 
               height={chartHeight} 
               yDomain={chartDomain}
             >
                <VerticalBarSeries
                    data={data}
                />
            </XYPlot>
    );
  }
}

export default MyLinegraph;
